description:
Men in Black director Barry Sonnenfeld and comics genius Grant Morrison's project, in which dinosaurs fight aliens in a massive multimedia endeavor is set to span a film trilogy and several tie-in comics. It's described as &quot;a philosophical treatise on manifest destiny, genocide and indigenous revolt&quot; and &quot;instead of anotherblockbuster thrown onto Hollywood's disposable entertainment pile, it's a pointed critique of overreaching civilization at the edge of oblivion.&quot;

PUBLISHED BY LIQUID

